import { Morph } from "lively.morphic/morph.js";
import { Database } from "lively.storage/index.js";
import { connect } from "lively.bindings/index.js";
import { resource } from "lively.resources/index.js";
import { loadObjectFromPartsbinFolder } from "lively.morphic/partsbin.js";

export default class Scrummy extends Morph {
  async onLoad() {
    var saveButton = this.get('controlFrame').get('saveButton'),
        DBButton = this.get('controlFrame').get('DBButton'),
        LoadDBButton = this.get('controlFrame').get('LoadDBButton')
    connect(saveButton,'trigger',this,'saveEntry')
    connect(DBButton,'trigger',this,'setRemoteDB')
    connect(LoadDBButton,'trigger',this,'loadDB')
    await this.dbsetup();
    this.submorphs.forEach(function(ea){
      if(ea.onLoad && typeof ea.onLoad == 'function'){
        ea.onLoad();
      }
    })
  }
  async dbsetup() {
    var dbName = "scrummies",
    remoteDB = Database.ensureDB("http://192.168.75.128:5984/" + dbName),
    localDB = Database.ensureDB(dbName),
    opts = {live: true};    
    this.databases = {local: localDB, remote: remoteDB, opts}
  }
  async writeLocal(id_field,obj){
    var resp =  await this.databases.local.set(id_field,obj)
    alert('Record Saved')
    return resp
  }
  async syncDBs(){
    var {remote,opts} = this.databases
    try {
      var resp = await this.databases.local.sync(remote,opts)

    } catch (e) {
       console.log({Error: e})
    } 


    return resp
  }
  getDate(){
    var months = ["Jan", "Feb", "Mar", 
"Apr", "May", "Jun", "Jul", "Aug", "Sep", 
"Oct", "Nov", "Dec"]
      var today = new Date,
      dd = today.getDate(),
      mm = today.getMonth(),
      yyyy = today.getFullYear(),
      timeStr = months[mm] + "-" + dd + "-" + yyyy
      return timeStr;
  }
  async saveEntry(){
      var dateStr = this.getDate(),
          thisWeek = this.get('TWActivityList').get('ListContainer').getEntries(),
          nextWeek = this.get('NWActivityList').get('ListContainer').getEntries(),
          name = this.get('NameField').getValue(),
          email = this.get('EmailField').getValue(),
          user = {name,email},
          obj = {user,date: dateStr,thisWeek,nextWeek}      
      // console.log(obj)

      try {
        let localresp = await this.writeLocal(name + "_" + dateStr, obj)
        let remoteresp = await this.syncDBs(); 
      } catch(e) {
        console.log(e)
      } finally {
        console.log({localresp,remoteresp})        
      }     

  } 
  async setRemoteDB() {
    var db = window.prompt("Please enter DB Server Address", "http://192.168.75.128:5984/"),
    self = this;

    if (db == null || db == "") {
      console.log('Entry cancelled')
    } else {
      var content = await resource(db).readJson()
      if (content.couchdb){
        self.databases.remote = Database.ensureDB(db + 'scrummies')
      } else {
        alert('Invalid DB selected: \n' + db)
      }
    }

  }
  async loadDB() {
    this.databases.local.sync(this.databases.remote,{live:true})
    var self = this;
    var users = (await this.databases.local.getAll()).map(function(ea){
      if (!ea.date){ea.date = "No Date"}
      var tt = self.makett(ea)
      var obj = {
        id : ea._id,        
        ...ea,        
        tt: tt,
        label: ea.user ? ea.user.name : "Unknown"

      }
      return obj
    }),
    dates = Array.from(new Set(users.map(function(ea){
      if (!ea.date){
        ea.date = "Unknown"
      }
      return ea.date
    }))).map(function(ea){

      return {tt: ea, label: 'Scrummies Filed on ' + ea, _id: ea, type: "Date",color: 'rgba(97,195,238,1)'}
    })

    var nodes = users.concat(dates),
        edges = nodes.filter(function(ea){
          return ea.type != 'Date'
        }).map(function(ea){          
            return {from: ea.id, to: ea.date, _id: ea.id + '_' + ea.date}          
        }),
        opts = {
          events : [
            {
              name: 'doubleClick',
              fn: async (params)=>{
                console.log(params)
                var obj = visMorph.data.nodes.get(params.nodes[0])
                console.log(obj)
                var {user,nextWeek,thisWeek} = obj
                return
                var displayScrummy = await loadObjectFromPartsbinFolder('Scrummy')
                var inner = displayScrummy.get('Scrummy')
                inner.setWeek('TWActivityList',thisWeek)
                inner.setWeek('NEWActivityList',nextWeek)
              }
            }
          ]
        }
    var windowMorph = await loadObjectFromPartsbinFolder('CategoryVisualization')
    await windowMorph.openInWorld()    
        var visMorph = windowMorph.get('visjsMorph')
     await  new Promise((resolve, reject) => {
            var count = 0;
            function testNetwork(){
              if (visMorph.network){
                resolve("Success!"); 
              } else if (count<5){
                count++
                setTimeout(testNetwork,20)
              } else {
                reject("Graph Not Loaded")
              }
            }
           testNetwork();

       })    
    var ans = await new Promise(function(resolve,reject){
      if (visMorph.loadExternalData({nodes,edges,opts})){
        resolve("Success")
      } else {
        reject("Cannot Load External Data to VizDB");
      }
    })
  }
  makett(obj) {
    if (!obj.user){
      obj.user = {
        name: 'Unknown',
        email: 'Unknown'
      }
    }
    var name = '<B>Name:</B> ' + obj.user.name,
        email = '<B>Email:</B> ' + obj.user.email,
        date = '<B>Date: </B>' + obj.date.split('-').join(' ')
    return  name + '<BR>' + email + '<BR>' + date

  }
  repop(record) {
    this.get('NWActivityList').get('ListContainer').setEntries()
  }
}

