import { Morph } from "lively.morphic/morph.js";
import { connect } from "lively.bindings/index.js";
import { loadObjectFromPartsbinFolder } from "lively.morphic/partsbin.js";

export default class ListContainer extends Morph {
  onLoad(){
    connect(this.get('addButton'),'trigger',this,'addButton')
    connect(this.get('editButton'),'trigger',this,'editButton')
    connect(this.get('deleteButton'),'trigger',this,'deleteButton')
  }
  async addButton() {
    // alert('add')
    var obj = await this.makeObj();
    obj.target = this
    obj.openInWorld()
    obj.idx = null

  }
  async editButton(){
    var list = this.get('activityList') 
    if (list.items.length == 0){ return };
    var idx = list.selectedIndex
    var txt = list.items[idx].string
    var obj = await this.makeObj(txt);
    obj.target = this
    obj.idx = idx
    obj.openInWorld()

  }
  deleteButton(){    
    var list = this.get('activityList')
    var idx = list.selectedIndex
    if(list.items.length == 1){
      list.items = []
      return
    }
    list.items.splice(idx,1)
    list.selectedIndex = idx - 1
  }
  async makeObj(text) {
     var morph = $world.get('ScrummyContentEntry')
     if(!morph){
       morph = await loadObjectFromPartsbinFolder('ScrummyContentEntry')
     }
     morph.get('ScrummyContentEntry').prepopBox(text)
     return morph
  }
  addObj(obj){    
    this.get('activityList').addItem(this.formatObj(obj))
  }
  updateObj(idx,obj){
    var list = this.get('activityList')
    if(list.items.length ==1){
      list.items = []
    } else {      
      list.items.splice(idx,1)      
    }
    list.addItemAt(obj,idx)
  }  
  formatObj(obj){
    //Formatting will go here
    return obj
  }
  getEntries(){
    return this.get('activityList').items
  }
}

